import React from 'react'
import './sass/card.css'

const Card = (props)=>{
    return(
        <>
        <div className="card">
            <div className="card-main">
                <div className="card-img">
                    <img src={props.src} alt="" />
                </div>
                <div className="card-title">Eternals</div>
                <div className="card-info">Watch on Fmovies</div>
                <div className="card-link"><a href="https://fmovies.to/movie/eternals-5wwrq/1-full" target='__blank'>Watch Now</a></div>
            </div>
        </div>
        </>
    )

}

const Cards=()=>{
    return(
        <>
        <Card src="https://terrigen-cdn-dev.marvel.com/content/prod/1x/eternals_lob_crd_06.jpg"></Card>
        </>
    )
}

export default Cards
